tables.table_schema:
CREATE TABLE daily_progress_logs (
    id INT PRIMARY KEY,
    timestamp TIMESTAMPTZ NOT NULL,
    work_completed TEXT,
    issues_encountered TEXT
);

CREATE TABLE users (
    user_id INT PRIMARY KEY,
    username TEXT NOT NULL,
    email TEXT
);

CREATE TABLE progress_images (
    image_id INT PRIMARY KEY,
    progress_id INT REFERENCES daily_progress_logs(id),
    image_url TEXT
);
